import React from 'react';
import FluenceMapRow from './FluenceMapRow.js'

class FluenceMap extends React.Component {
    getRows(rows) {
        var cells = []
        for(var i=0; i < rows.length; i++) {
            cells.push(<FluenceMapRow row={this.props.matrix[i]} />)
        }
        console.log(cells)
        return cells
    }

    handleClick = () => {
        this.setState({ forceRender: !this.state.forceRender });
    };

    render() {
        return (
            <div>
                <div>
                    {this.getRows(this.props.matrix)}
                </div>
                <div className='center'>
                    <button class='button' onClick={this.handleClick}>Regenerate Matrix</button>
                </div>
            </div>
        );
    }
}

export default FluenceMap;
